import React from 'react';
import { useNavigate } from 'react-router-dom';
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import '../styles/Home.css';

function Home() {
    const navigate = useNavigate();

    const handleShopNow = () => {
        navigate('/products');
    };

    const carouselItems = [
        {
            image: 'https://via.placeholder.com/300x200',
            title: 'Rustic Floral Arrangement',
            price: '$25.99',
            desc: 'Beautiful floral arrangement perfect for rustic-themed weddings.',
        },
        {
            image: 'https://via.placeholder.com/300x200',
            title: 'Elegant Tableware Set',
            price: '$45.99',
            desc: 'Sophisticated tableware for a truly elegant event.',
        },
        {
            image: 'https://via.placeholder.com/300x200',
            title: 'Custom Banner',
            price: '$15.99',
            desc: 'Personalized banner for your special event.',
        },
    ];

    const responsive = {
        desktop: { breakpoint: { max: 3000, min: 1024 }, items: 3 },
        tablet: { breakpoint: { max: 1024, min: 464 }, items: 2 },
        mobile: { breakpoint: { max: 464, min: 0 }, items: 1 },
    };

    return (
        <div className="home-container">
            <div className="background-overlay" />
            <h1 className="home-header">Welcome to the Wedding E-Commerce Website</h1>
            <p className="home-subtitle">
                Discover elegant and customizable decor for weddings and events.
            </p>

            <div className="carousel-container">
                <Carousel
                    responsive={responsive}
                    infinite={true}
                    autoPlay={true}
                    autoPlaySpeed={3000}
                    keyBoardControl={true}
                    transitionDuration={500}
                    containerClass="carousel-container"
                >
                    {carouselItems.map((item, index) => (
                        <div className="carousel-card" key={index}>
                            <img src={item.image} alt={item.title} className="carousel-image" />
                            <div className="carousel-card-content">
                                <h2 className="carousel-card-title">{item.title}</h2>
                                <p className="carousel-card-price">{item.price}</p>
                                <p className="carousel-card-desc">{item.desc}</p>
                                <button className="cta-button" onClick={handleShopNow}>
                                    Shop Now
                                </button>
                            </div>
                        </div>
                    ))}
                </Carousel>
            </div>

            <footer className="footer">
                <div className="footer-section about-us">
                    <h3>About Us</h3>
                    <p>
                        \"Wedding E-Commerce\" is your ultimate destination for all your wedding needs.
                        From wedding attire to decorations, we provide everything to make your special day unforgettable.
                    </p>
                </div>
                <div className="footer-section contact-us">
                    <h3>Contact Us</h3>
                    <button className="social-button facebook">Facebook</button>
                    <button className="social-button instagram">Instagram</button>
                    <button className="social-button email">Email Us</button>
                </div>
                <div className="footer-section quick-links">
                    <h3>Quick Links</h3>
                    <ul>
                        <li>Home</li>
                        <li>Products</li>
                        <li>About Us</li>
                        <li>Login</li>
                    </ul>
                </div>
            </footer>
        </div>
    );
}

export default Home;
